roomn=nil
room=nil

player={sprb=292
       , spr=293	} -- *** change later

function start_game() 
 scene=sc_explore
	if DEBUG then
	 enter_room(15,1)
	else
  enter_room(1,1)
	end
end

function enter_room(rn,en)
 roomn=rn
 room=rooms[rn]
	ent=room.ent[en]
	player.x=ent.px-room.mx
	player.y=ent.py-room.my
end

function sc_explore()
	cls(0)
	map(room.mx,room.my)
	if DEBUG then print("ROOM #"..roomn) end

 if room.mobs then
 for mn,mi in pairs(room.mobs) do
	 if not mi.t then mi.t = 0 end
		
	 spr(mi.ms,( mi.mx-room.mx)*8,( mi.my-room.my)*8, 0)

  if mi.t == 0 then
		 mi.t = 30
			
			local mdy=-1
			if math.random(2) % 2 == 0 then
			 mdy=1
		 end
			
			local mny = mi.my + mdy
			if not fget(mget(mi.mx, mny), 0) then
				mi.my = mny
			end		
		else
		 mi.t = mi.t - 1
		end		
		
	end
 end

	p=player
	spr(p.spr,p.x*8,p.y*8,0)
	
	function move(dx,dy)
	 nx=p.x+dx
		ny=p.y+dy
		mnx=room.mx+nx
		mny=room.my+ny
		if room.ext then
		for ei,e in ipairs(room.ext) do
		 if mnx==e.x and mny==e.y then
			 enter_room(e.r,e.e)
				return
			end
		end
		end
		if not fget(mget(					mnx,mny),0) then
		 p.x=nx
			p.y=ny
			p.spr=p.sprb+(((p.spr-p.sprb)+1)%2)
			return
		end
		--- XXX add a bump sound
	end
	if btnp(0,1,10) then move(0,-1) end
	if btnp(1,1,10) then move(0,1) end
	if btnp(2,1,10) then move(-1,0) end
	if btnp(3,1,10) then move(1,0) end
	
end

start_game()
